import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const CreateSpace = () => {
  const [spaceName, setSpaceName] = useState('');
  const [location, setLocation] = useState('');
  const [capacity, setCapacity] = useState('');
  const [amenities, setAmenities] = useState('');
  const [rate, setRate] = useState('');
  const [image, setImage] = useState(null);
  const [submitted, setSubmitted] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    setSubmitted(true);
    // Add logic to handle form submission, e.g., sending data to a server
  };

  const handleImageChange = (e) => {
    setImage(e.target.files[0]);
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-blue-200">
      <header className="absolute top-0 left-0 w-full p-4 flex justify-between items-center bg-white shadow-md">
        <a href="/" className="flex items-center space-x-2">
          <img src="/path/to/logo.png" alt="Space Hub Logo" className="w-20 h-18" />
        </a>
        <nav className="flex space-x-4">
          <Link to="/dashboard" className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">Back to Dashboard</Link>
          <button className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded">Logout</button>
        </nav>
      </header>

      <form className="bg-white shadow-lg rounded-lg px-10 pt-8 pb-12 mb-4 w-full max-w-lg transition-transform transform hover:scale-103 duration-500 ease-in-out" onSubmit={handleSubmit}>
        <h2 className="text-2xl text-center font-bold mb-6">Create a Space</h2>

        <div className="mb-4">
          <label htmlFor="image" className="block text-gray-700 text-sm font-bold mb-2">Image</label>
          <input
            type="file"
            id="image"
            onChange={handleImageChange}
            className="shadow-md appearance-none border border-blue-300 rounded w-full py-3 px-4 text-gray-700 leading-tight focus:outline-none focus:shadow-outline transition-transform transform hover:scale-105 duration-300"
          />
        </div>

        <div className="mb-4">
          <label htmlFor="spaceName" className="block text-gray-700 text-sm font-bold mb-2">Space Name</label>
          <input
            type="text"
            id="spaceName"
            value={spaceName}
            onChange={(e) => setSpaceName(e.target.value)}
            placeholder="Enter space name"
            className="shadow-md appearance-none border border-blue-300 rounded w-full py-3 px-4 text-gray-700 leading-tight focus:outline-none focus:shadow-outline transition-transform transform hover:scale-105 duration-300"
          />
        </div>

        <div className="mb-4">
          <label htmlFor="location" className="block text-gray-700 text-sm font-bold mb-2">Location</label>
          <input
            type="text"
            id="location"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            placeholder="Enter location"
            className="shadow-md appearance-none border border-blue-300 rounded w-full py-3 px-4 text-gray-700 leading-tight focus:outline-none focus:shadow-outline transition-transform transform hover:scale-105 duration-300"
          />
        </div>

        <div className="mb-4">
          <label htmlFor="capacity" className="block text-gray-700 text-sm font-bold mb-2">Capacity</label>
          <input
            type="text"
            id="capacity"
            value={capacity}
            onChange={(e) => setCapacity(e.target.value)}
            placeholder="Enter capacity"
            className="shadow-md appearance-none border border-blue-300 rounded w-full py-3 px-4 text-gray-700 leading-tight focus:outline-none focus:shadow-outline transition-transform transform hover:scale-105 duration-300"
          />
        </div>

        <div className="mb-4">
          <label htmlFor="amenities" className="block text-gray-700 text-sm font-bold mb-2">Amenities</label>
          <textarea
            id="amenities"
            value={amenities}
            onChange={(e) => setAmenities(e.target.value)}
            placeholder="Enter amenities"
            className="shadow-md appearance-none border border-blue-300 rounded w-full py-3 px-4 text-gray-700 leading-tight focus:outline-none focus:shadow-outline transition-transform transform hover:scale-105 duration-300"
          ></textarea>
        </div>

        <div className="mb-4">
          <label htmlFor="rate" className="block text-gray-700 text-sm font-bold mb-2">Rate (per hour)</label>
          <input
            type="text"
            id="rate"
            value={rate}
            onChange={(e) => setRate(e.target.value)}
            placeholder="Enter rate"
            className="shadow-md appearance-none border border-blue-300 rounded w-full py-3 px-4 text-gray-700 leading-tight focus:outline-none focus:shadow-outline transition-transform transform hover:scale-105 duration-300"
          />
        </div>

        <div className="flex items-center justify-center mb-4">
          <button
            type="submit"
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-3 px-6 rounded focus:outline-none focus:shadow-outline transition-transform transform hover:scale-105 duration-300"
          >
            Submit
          </button>
        </div>

        <p className="text-gray-600 text-md text-center">
          Go back to <Link to="/dashboard" className="text-blue-500">Dashboard</Link>
        </p>
      </form>
    </div>
  );
};

export default CreateSpace;
